import React, { Component } from 'react';

class Skills extends Component {

  render() {
    return (
    	<React.Fragment>

    		<div id="myProgress">
                <div id="myBar">80%</div>
            </div>

    	</React.Fragment >
    );
  }
}

export default Skills;
